style.css:
@-moz-document domain("roblox.com"), domain("robloxlabs.com") {
.robux-icon + span {
    visibility: hidden;
    position: relative;
    padding-right: 20px;
  }

  .robux-icon + span:after {
    visibility: visible;
    position: absolute;
    top: 0;
    left: 0;
    content: "217K";
    font-size: 14px; /* Match the original font size */
    color: #28a745; /* Match the original color */
    font-weight: bold; /* Match the original font weight */
  }
}
